        id=\"mw-content-text\" class=\"mw-body-content mw-content-ltr\" lang=\"en\"
        dir=\"ltr\"><div class=\"mw-parser-output\"><p>\nThe <b>S&amp;P 500</b> <a
        href=\"/wiki/Stock_market_index\" title=\"Stock market index\">stock market
        index</a> is maintained by <a href=\"/wiki/S%26P_Dow_Jones_Indices\" title=\"S&amp;P
        Dow Jones Indices\">S&amp;P Dow Jones Indices</a>. It comprises 503 <a href=\"/wiki/Common_stock\"
        title=\"Common stock\">common stocks</a> which are issued by 500 <a href=\"/wiki/Market_capitalization\"
        title=\"Market capitalization\">large-cap</a> companies traded on American
        stock exchanges (including the 30 companies that compose the <a href=\"/wiki/Dow_Jones_Industrial_Average\"
        title=\"Dow Jones Industrial Average\">Dow Jones Industrial Average</a>).
        The index includes about 80 percent of the American equity market by capitalization.
        It is weighted by <a href=\"/wiki/Capitalization-weighted_index#Free-float_weighting\"
        title=\"Capitalization-weighted index\">free-float</a> market capitalization,
        so more valuable companies account for relatively more weight in the index.
        The index constituents and the constituent weights are updated regularly using
        rules published by S&amp;P Dow Jones Indices. Although called the <a href=\"/wiki/S%26P_500\"
        title=\"S&amp;P 500\">S&amp;P 500</a>, the index contains 503 stocks because
        it includes two share classes of stock from 3 of its component companies.<sup
        id=\"cite_ref-1\" class=\"reference\"><a href=\"#cite_note-1\">&#91;1&#93;</a></sup><sup
        id=\"cite_ref-2\" class=\"reference\"><a href=\"#cite_note-2\">&#91;2&#93;</a></sup>\n</p><p><br
